(32, 1, '2021-09-01 09:54:25', '2021-09-01 09:54:25', '<hr class=\"a-divider-normal bucketDivider\" aria-hidden=\"true\" />\r\n\r\n<h2>Product details</h2>\r\n<div id=\"detailBullets_feature_div\">\r\n<ul class=\"a-unordered-list a-nostyle a-vertical a-spacing-none detail-bullet-list\">\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Publisher ‏ : ‎ </span>Fingerprint! Publishing (1 February 2015)</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Language ‏ : ‎ </span>English</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Paperback ‏ : ‎ </span>256 pages</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">ISBN-10 ‏ : ‎ </span>8172345666</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">ISBN-13 ‏ : ‎ </span>978-8172345662</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Item Weight ‏ : ‎ </span>280 g</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Dimensions ‏ : ‎ </span>20 x 14 x 4 cm</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Country of Origin ‏ : ‎ </span>India</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Importer ‏ : ‎ </span>011-23247062</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Best Sellers Rank: </span>#77 in Books (<a href=\"https://www.amazon.in/gp/bestsellers/books/ref=pd_zg_ts_books\">See Top 100 in Books</a>)</span>\r\n<ul class=\"a-unordered-list a-nostyle a-vertical zg_hrsr\">\r\n 	<li><span class=\"a-list-item\">#39 in <a href=\"https://www.amazon.in/gp/bestsellers/books/1318128031/ref=pd_zg_hrsr_books\">Health, Family &amp; Personal Development (Books)</a></span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</div>', 'The Power of Your Subconscious Mind Paperback – 1 February 2015', '<h3>About the Author</h3>\r\n<div class=\"a-section a-spacing-small a-padding-small\">Joseph Murphy was a Divine Science minister and author. Murphy was born in Ireland, the son of a private boy\'s school headmaster and raised a Roman Catholic. He studied for the priesthood and joined the Jesuits. In his twenties an experience with healing prayer led him to leave the Jesuits and move to the United States. Murphy has given lectures and written books for audiences all over the world. In his lectures he points out how real people can radically improve their lives by applying specific aspects of his concepts.</div>\r\n<div></div>\r\nThis remarkable book by Dr. Joseph Murphy, one of the pioneering voices of affirmative thinking, will unlock for you the truly staggering powers of your subconscious mind. Combining time-honored spiritual wisdom with cutting edge scientific research, Dr. Murphy explains how the subconscious mind influences every single thing that you do and how, by understanding it and learning to control its incredible force, you can improve the quality of your daily life.\r\n\r\nEverything, from the promotion that you wanted and the raise you think you deserve, to overcoming phobias and bad habits and strengthening interpersonal relationships, the Power of Your Subconscious Mind will open a world of happiness, success, prosperity and peace for you. It will change your life and your world by changing your beliefs.', 'publish', 'open', 'closed', '', 'the-power-of-your-subconscious-mind-paperback-1-february-2015', '', '', '2021-09-07 17:16:09', '2021-09-07 17:16:09', '', 0, 'http://localhost/WordPress/wordpress-5.8/ecommerce/?post_type=product&#038;p=32', 0, 'product', '', 0),
(33, 1, '2021-09-01 09:57:21', '2021-09-01 09:57:21', '<h2>Product description</h2>\r\n<div class=\"a-section a-spacing-small a-padding-base\">\r\n<h3>Review</h3>\r\n<div class=\"a-section a-spacing-small a-padding-small\">\"Utilizing the healing power of color and Inna Segal\'s personal healing techniques, these striking images, each with its own healing vibration, provide an easily accessible tool for bringing health and well-being into our lives.\"\r\n—Anna Jedrziewski, editor-at-large for <i>New Age Retailer</i>\"With <i>The Secret Language of Color Cards</i>, Inna Segal offers the key to unlocking the extraordinary healing power of color. With an easy-to-use guidebook and 45 vibrant cards, each infused with a unique healing vibration, it\'s easier than ever to bring joy, harmony, balance, and wellness to all aspects of life. Combining tips and information on colors with powerful healing processes and affirmations, this vibrant card set can help readers restore their bodies to their natural states of health and harmony.\"\r\n—<i>Eart Star</i>\r\n\r\n</div>\r\n<h3>About the Author</h3>\r\n<div class=\"a-section a-spacing-small a-padding-small\">Inna Segal is a gifted healer and a pioneer in the field of energy medicine and human consciousness. She can psychically ‘see’ illness and blocks in a person’s body, by intuitive means, and can explain what is occurring and guide the person through a self-healing process. Inna’s work has been endorsed by many well-known authors, alternative doctors and nurses, psychologists and health professionals. Inna has travelled throughout the USA, Australia, Germany, France, Asia, Slovakia, the UK and the Caribbean teaching her practical, life-changing techniques. <a href=\"http://www.innasegal.com/\">http://www.innasegal.com</a></div>\r\n</div>\r\n<div>\r\n\r\n<hr class=\"a-divider-normal bucketDivider\" aria-hidden=\"true\" />\r\n\r\n<h2>Product details</h2>\r\n<div id=\"detailBullets_feature_div\">\r\n<ul class=\"a-unordered-list a-nostyle a-vertical a-spacing-none detail-bullet-list\">\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">ASIN ‏ : ‎ </span>1582703264</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Publisher ‏ : ‎ </span>Atria Books/Beyond Words; Box Crds/B edition (11 October 2011)</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Language ‏ : ‎ </span>English</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Cards ‏ : ‎ </span>84 pages</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">ISBN-10 ‏ : ‎ </span>9781582703268</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">ISBN-13 ‏ : ‎ </span>978-1582703268</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Item Weight ‏ : ‎ </span>387 g</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Dimensions ‏ : ‎ </span>17.15 x 3.56 x 12.7 cm</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Country of Origin ‏ : ‎ </span>USA</span></li>\r\n 	<li><span class=\"a-list-item\"><span class=\"a-text-bold\">Best Sellers Rank: </span>#38,883 in Books (<a href=\"https://www.amazon.in/gp/bestsellers/books/ref=pd_zg_ts_books\">See Top 100 in Books</a>)</span>\r\n<ul class=\"a-unordered-list a-nostyle a-vertical zg_hrsr\">\r\n 	<li><span class=\"a-list-item\">#343 in <a href=\"https://www.amazon.in/gp/bestsellers/books/10533831031/ref=pd_zg_hrsr_books\">Mental &amp; Spiritual Healing</a></span></li>\r\n 	<li><span class=\"a-list-item\">#1,310 in <a href=\"https://www.amazon.in/gp/bestsellers/books/1318130031/ref=pd_zg_hrsr_books\">Healthy Living &amp; Wellness</a></span></li>\r\n</ul>\r\n</li>\r\n</ul>\r\n</div>\r\n</div>', 'The Secret Language of Color Cards Cards – 11 October 2011', '<i>The Secret Language of Color Cards</i> is your key to unlocking the extraordinary healing power of color. Featuring 45 stunning cards, each infused with a unique healing vibration, and an accompanying 84-page guidebook, author Inna Segal will assist you in adding more joy, harmony, and wellness to all areas of your life.\r\n\r\nWith various creative ways to use the cards—including simply asking a question and picking a card, placing a color card on an area of the body that needs that color’s particular healing attention, and color visualization—along with the aid of the guidebook anyone can interpret and create useful practices of wellness. Each color\'s unique vibrations are there to explore, from silvers ability to strengthen your persistence, plum helping you to overcome challenges, burgundy to awaken passion, and emerald to create a calm, mind, body, and spirit, these vibrant and powerful cards by Inna Segal are a tool anyone can use daily to receive inspired and intuitive messages of guidance and to restore their body to its natural state of balance and harmony.', 'publish', 'open', 'closed', '', 'the-secret-language-of-color-cards-cards-11-october-2011', '', '', '2021-09-07 17:17:28', '2021-09-07 17:17:28', '', 0, 'http://localhost/WordPress/wordpress-5.8/ecommerce/?post_type=product&#038;p=33', 0, 'product', '', 0),
